script_name("Evolve Logs")
script_author("Mary_Norton")
script_version("1.0.0")

require("lib.moonloader")
require("lib.sampfuncs")

local scriptDir = thisScript().path:match("^(.*)\\[^\\]+$") or getWorkingDirectory()
local evolvelogsDir = scriptDir .. "\\EvolveLogs"
package.path = package.path .. ";" .. evolvelogsDir:gsub("\\", "/") .. "/?.lua"

-- URL для первичной загрузки модулей (когда папки EvolveLogs ещё нет)
local BOOTSTRAP_UPDATE_JSON = "https://raw.githubusercontent.com/Pugovka/evolvelogs/main/update.json"

function needBootstrap()
    if not doesDirectoryExist(evolvelogsDir) then return true end
    local libsLoader = evolvelogsDir .. "\\modules\\libs_loader.lua"
    return not doesFileExist(libsLoader)
end

function createParentDirs(filePath)
    local path = filePath:gsub("/", "\\")
    local segments = {}
    for s in path:gmatch("[^\\]+") do segments[#segments + 1] = s end
    if #segments < 2 then return end
    local base = scriptDir .. "\\"
    local acc = base
    for i = 1, #segments - 1 do
        acc = acc .. (i > 1 and "\\" or "") .. segments[i]
        if not doesDirectoryExist(acc) then createDirectory(acc) end
        acc = acc .. "\\"
    end
end

bootstrap_done = false

function runBootstrap()
    local download_status = require("moonloader").download_status
    local json = require("json")
    local tmp = os.tmpname()
    if doesFileExist(tmp) then os.remove(tmp) end
    downloadUrlToFile(BOOTSTRAP_UPDATE_JSON, tmp, function(_, status, _, _)
        if status ~= download_status.STATUSEX_ENDDOWNLOAD then return end
        if not doesFileExist(tmp) then return end
        local f = io.open(tmp, "r")
        if not f then os.remove(tmp); return end
        local content = f:read("*a")
        f:close()
        os.remove(tmp)
        local ok, data = pcall(json.decode, content)
        if not ok or not data or type(data.modules) ~= "table" or #data.modules == 0 then
            sampAddChatMessage("{EB2E4A}[ Evolve Logs ] {FFFFFF}Не удалось загрузить список модулей. Создайте папку EvolveLogs вручную.", -1)
            bootstrap_done = true
            return
        end
        local idx = 1
        function downloadNext()
            if idx > #data.modules then
                sampAddChatMessage("{EB2E4A}[ Evolve Logs ] {FFFFFF}Модули успешно загружены. Скрипт успешно перезагружен.", -1)
                wait(1000)
                thisScript():reload()
                bootstrap_done = true
                return
            end
            local entry = data.modules[idx]
            local path = (entry.path or entry[1]):gsub("/", "\\")
            local dest = scriptDir .. "\\" .. path
            createParentDirs(path)
            local tempFile = os.tmpname()
            if doesFileExist(tempFile) then os.remove(tempFile) end
            downloadUrlToFile(entry.url, tempFile, function(_, status)
                if status == download_status.STATUS_ENDDOWNLOADDATA or status == download_status.STATUSEX_ENDDOWNLOAD then
                    if doesFileExist(tempFile) then
                        local fr = io.open(tempFile, "rb")
                        if fr then
                            local content = fr:read("*a")
                            fr:close()
                            local fw = io.open(dest, "wb")
                            if fw then
                                fw:write(content or "")
                                fw:close()
                                print("[Evolve Logs] Загружен: " .. path)
                            end
                            os.remove(tempFile)
                        end
                    end
                end
                if status == download_status.STATUSEX_ENDDOWNLOAD then
                    idx = idx + 1
                    lua_thread.create(function()
                        wait(300)
                        downloadNext()
                    end)
                end
            end)
        end
        lua_thread.create(function()
            wait(500)
            downloadNext()
        end)
    end)
end

if needBootstrap() then
    bootstrap_done = false
    lua_thread.create(function()
        while not isSampLoaded() or not isSampfuncsLoaded() do wait(100) end
        while not isSampAvailable() do wait(100) end
        wait(4000)
        sampAddChatMessage("{EB2E4A}[ Evolve Logs ] {FFFFFF}Обнаружено отсутствие модулей. Загрузка с GitHub...", -1)
        runBootstrap()
        local start = os.clock()
        while not bootstrap_done and (os.clock() - start) < 90 do
            wait(100)
        end
        if not bootstrap_done then
            sampAddChatMessage("{EB2E4A}[ Evolve Logs ] {FFFFFF}Таймаут загрузки модулей (90 сек).", -1)
        end
    end)
    return
end

function logModule(name, ok, err)
    if ok then
        print("[Evolve Logs] Загружен: " .. name)
    else
        print("[Evolve Logs] Ошибка загрузки " .. name .. ": " .. tostring(err))
    end
end

function requireLogged(name)
    local ok, mod = pcall(require, name)
    logModule(name, ok, ok and mod or mod)
    return ok and mod or nil
end

