-- Sentry (отправка ошибок в Sentry; DSN из config)
local enable_sentry = true
if enable_sentry and config.SENTRY_DSN and config.SENTRY_DSN ~= "" then
    local Sentry = requireLogged("lib.sentry_reporter")
    if Sentry and Sentry.init then
        pcall(Sentry.init, {
            dsn = config.SENTRY_DSN,
            script_id = thisScript().id,
            script_name = thisScript().name,
            script_path = thisScript().path,
        })
    end
