if not state.settings.fraction then state.settings.fraction = 0 end
state.fraction = imgui.new.int(state.settings.fraction)

-- Автовыбор фракции из Government Tools
local org = settings.getOrganizationFromPersonalInfo()
if org and config.ORG_TO_FRACTION_INDEX[org] ~= nil then
    local idx = config.ORG_TO_FRACTION_INDEX[org]
