function buildCtx()
    return {
        imgui = imgui, fa = fa, key = key, u8 = u8, ffi = ffi,
        state = state, config = config, rankInfo = rankInfo, utils = utils, api = api,
        chatMsg = utils.chatMsg,
        saveSettings = function(st, fn) settings.saveSettings(st or state.settings, fn or utils.chatMsg) end,
        httpRequest = function(nick) api.httpRequest(nick, state, utils.chatMsg) end,
        openChangelog = function() state.changelog[0] = not state.changelog[0] end,
        scriptVersion = thisScript().version,
        scriptUnload = function() thisScript():unload() end,
        scriptReload = function() thisScript():reload() end,
        runUpdater = function()
            if Updater and enable_autoupdate then
                local json_url = config.UPDATE_JSON_URL .. "?" .. tostring(os.clock())
                pcall(Updater.check, json_url, "[" .. string.upper(thisScript().name) .. "]: ", config.UPDATE_BASE_URL)
            end
        end,
        fonts = {},
        evolvelogo = nil,
    }
end

local ctx = buildCtx()
local cum, smal, big
local evolvelogo = nil
imgui.OnInitialize(function()
    ui.DarkTheme(imgui)
    fa.Init()
    local iconRanges = imgui.new.ImWchar[3](ti.min_range, ti.max_range, 0)
    imgui.GetIO().Fonts:AddFontFromMemoryCompressedBase85TTF(ti.get_font_data_base85(), 14, imgui.ImFontConfig(), iconRanges)
    imgui.GetIO().IniFilename = nil
    local glyph_ranges = imgui.GetIO().Fonts:GetGlyphRangesCyrillic()
    cum = imgui.GetIO().Fonts:AddFontFromFileTTF(getFolderPath(0x14) .. "\\arial.ttf", 13, nil, glyph_ranges)
    imgui.GetIO().Fonts:AddFontFromFileTTF(getFolderPath(0x14) .. "\\trebucbd.ttf", 14.0, nil, glyph_ranges)
    smal = imgui.GetIO().Fonts:AddFontFromFileTTF(getFolderPath(0x14) .. "\\arial.ttf", 15.5, nil, glyph_ranges)
    big = imgui.GetIO().Fonts:AddFontFromFileTTF(getFolderPath(0x14) .. "\\trebucbd.ttf", 20.0, nil, glyph_ranges)
    local logo = (ui.logo_data or logo_data)
    if logo and #logo > 0 then
        evolvelogo = imgui.CreateTextureFromFileInMemory(memory.strptr(logo), #logo)
    end
    ctx.fonts = { cum = cum, smal = smal, big = big }
    ctx.evolvelogo = evolvelogo
end)

ui.extendImgui(imgui, u8, key)

function setMainWindowNext(size)
    size = size or imgui.ImVec2(config.WINDOW_WIDTH, config.WINDOW_HEIGHT)
    imgui.SetNextWindowSize(size, imgui.Cond.FirstUseEver)
    local res = imgui.ImVec2(getScreenResolution())
    imgui.SetNextWindowPos(imgui.ImVec2(res.x / 2, res.y / 2), imgui.Cond.FirstUseEver, imgui.ImVec2(0.5, 0.5))
end

function main()
    if not isSampLoaded() or not isSampfuncsLoaded() then return end
    while not isSampAvailable() do wait(0) end
    pcall(sampUnregisterChatCommand, "elogs")
    pcall(sampUnregisterChatCommand, "updlist")
    sampRegisterChatCommand("elogs", cmd_logs)
    if Updater and enable_autoupdate then
        lua_thread.create(function()
            wait(2000)
            local json_url = config.UPDATE_JSON_URL .. "?" .. tostring(os.clock())
            pcall(Updater.check, json_url, "[" .. string.upper(thisScript().name) .. "]: ", config.UPDATE_BASE_URL)
        end)
    end
    sampRegisterChatCommand("updlist", cmd_changelog)
    api.checkServer()
    if not _G.evolvelogs_usage_shown then
        _G.evolvelogs_usage_shown = true
        utils.chatMsg("Используйте: /elogs [ID/Nick_Name]", false)
    end
    while true do
        wait(0)
        if state.window[0] then
            imgui.ShowCursor = true
            imgui.Process = true
        end
    end
end

function cmd_logs(arg)
    lua_thread.create(function()
        if not arg or arg == "" then
            state.window[0] = not state.window[0]
            state.selectedMenu = 1
            return
        end
        local id = tonumber(arg)
        if id then
            if not sampIsPlayerConnected(id) then
                utils.chatMsg("Игрок с указанным ID не найден или не в зоне стрима.", true)
                return
            end
            state.window[0] = true
            state.selectedMenu = 1
            api.httpRequest(sampGetPlayerNickname(id), state, utils.chatMsg)
        else
            local nickname = arg:match("^(%S+)$")
            if nickname and nickname:match("_") then
                state.window[0] = true
                state.selectedMenu = 1
                api.httpRequest(nickname, state, utils.chatMsg)
            else
                utils.chatMsg("Укажите корректный никнейм!", true)
            end
        end
    end)
end

function cmd_changelog()
    state.changelog[0] = not state.changelog[0]
end

function onWindowMessage(msg, wParam, lParam)
    if (msg == 0x100 or msg == 0x101) and wParam == key.VK_ESCAPE and not isPauseMenuActive() then
        if state.changelog[0] then
            consumeWindowMessage(true, false)
            state.changelog[0] = false
        elseif state.window[0] then
            consumeWindowMessage(true, false)
            state.window[0] = false
        end
    end
end

imgui.OnFrame(
    function() return state.window[0] end,
    function()
        setMainWindowNext()
        if imgui.Begin(u8"Evolve Logs", state.window, imgui.WindowFlags.NoCollapse + imgui.WindowFlags.NoTitleBar + imgui.WindowFlags.NoResize) then
            ui.drawSideMenu(ctx)
        end
        imgui.End()
    end
)

imgui.OnFrame(
    function() return state.changelog[0] end,
    function()
        setMainWindowNext()
        if imgui.Begin(fa.CLOCK .. u8" Об обновлениях", state.changelog, imgui.WindowFlags.NoCollapse + imgui.WindowFlags.NoResize) then
            ui.drawChangelog(ctx)
        end
        imgui.End()
    end
)

